import styled from "styled-components";
import Logo from "../components/Logo";
import Botao from "../assets/GlobalStyle";

export default function Login(){
    return (
        <>
        <Logo/>
        <Email></Email>
        <Senha></Senha>
        <Botao></Botao>
        
        </>
    )
}

const Teste= styled.div`
    width:100px;
    heigth:100px;
    color: pink;
    font-size: 14px;
    font-weight: bold;
`
